        ordi_cart_id: {
          type: DataTypes.INTEGER,
          allowNull: false
        },
        ordi_prod_id: {
          type: DataTypes.INTEGER,
          allowNull: false
        },
        ordi_order_name: {
          type: DataTypes.STRING,
          allowNull: false,
          references: {
            model: 'orders',
            key: 'order_name'
          }
        }
      }, {
        sequelize,
        tableName: 'order_detail',
        schema: 'public',
        timestamps: false
      });
      OrderDetail.removeAttribute('id');
      OrderDetail.associate = models => {
      OrderDetail.belongsTo(models.orders, {onDelete: 'CASCADE' });
      OrderDetail.belongsTo(models.cart,{onDelete: 'CASCADE' })
      }
      return OrderDetail;
    }
export default orderDetail;

